import React, { useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./Pages/Home";
import Education from "./Pages/Education";
import Contact from "./Pages/Contact";
import Projects from "./Pages/Projects";
import Progress from "./Pages/Skills";
import NavBar from "./Components/NavBar";

const Layout = () => {
  const [darkMode, setDarkMode] = useState(false);

  const changeMode = () => {
    setDarkMode(!darkMode);
  };
  return (
    <div className={`${darkMode && "dark"}`}>
      <button
        className="absolute w-8 h-8 mt-3 text-white rounded-full right-16 bg-neutral-600 dark:bg-white dark:text-black"
        onClick={changeMode}
      >
        <i
          class={darkMode ? `${"fa-solid fa-sun"}` : `${"fa-solid fa-moon"}`}
        ></i>
      </button>
      <BrowserRouter className={`${darkMode && "dark"}`}>
        <NavBar />
        <Routes>
          <Route path="/" element={<Home />}></Route>
          <Route path="/education" element={<Education />}></Route>
          <Route path="/contact" element={<Contact />}></Route>
          <Route path="/projects" element={<Projects />}></Route>
          <Route path="/skills" element={<Progress />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default Layout;
